import React from 'react';
import './style.css';

class Body extends React.Component {
  render = ()=>{
    return (
      <div className='body'>
        <p id="about" className='intro-header'>
        Hello I'm <b>Neil,</b><br/>
        a <b>sophomore Computer Science major</b> at <br/>
        <b>UCLA</b> (University of California, Los Angeles)
       </p>

       <div class="next-section-button-container">
       <button class="next-section-button">Skills</button>
       </div>

      </div>
    );
  }
}

export default Body;
